import React from "react";
import logo from "./logo.svg";
import { Suspense } from "react";
// import Pokedex from "./components/pokedex";
const Pokedex = React.lazy(() => import('./components/pokedex'));

function App() {

  return (
    <Suspense>
      <Pokedex></Pokedex>;
    </Suspense>
  )
}

export default App;
